DROP TABLE vehicles;

CREATE TABLE vehicles (
    id int IDENTITY(1,1) PRIMARY KEY,
    knr varchar(50),
    aggregate varchar(20),
	seats INT,
	creation_date DATE,
	order_status varchar(10),
	order_version VARCHAR(10),
	order_plant VARCHAR(10),
	foreign_dealer VARCHAR(10),
	vehicle_series VARCHAR(10),
	vehicle_status VARCHAR(20),
	color VARCHAR(10),
	color_exernal VARCHAR(10),
	color_roof VARCHAR(10),
	color_internal VARCHAR(10),
	gear_type VARCHAR(10),
	gro_hnd_land VARCHAR(10),
	komm_nr VARCHAR(10),
	countries VARCHAR(50),
	pin VARCHAR(50),
	schaugl_wo VARCHAR(10),
	tm VARCHAR(10),
	target_station VARCHAR(10),
	body_status VARCHAR(10)
);





